impl<V> Map<V> {
    fn new(
        context: Context,
        storage_slot: Field,
        state_var_constructor: fn(Context, Field) -> V,
    ) -> Map<V> {
        assert(storage_slot != 0, "Storage slot 0 not allowed. Storage slots must start from 1.");
        Map {
            context,
            storage_slot,
            state_var_constructor,
        }
    }

